import '../linkedIn.css';
import '../icomoon/style.css'

function Main() {
    return (
        <div className="main">
            <div className="main__left">
                <div className="about-block margin-bottom_20">
                    <span className="about__title">About</span>
                    <div className="about__text">
                        I'm more experienced in eCommerce web projects and mobile banking
                        apps, but also like to work with creative projects, such as landing
                        pages or unusual corporate websites.
                    </div>
                    <a href="" className="href_text blue_color uppercase">See more</a>
                </div>
            </div>
            <div className="main__right"></div>
        </div>
    );
}

export default Main;
